def smallest_multiple(n: int) -> int:
    """ For a given number n, find the smallest number that is evenly divisible by all numbers smaller than n
    >>> smallest_multiple(5)
    60
    """
    return smallest_multiple_helper(n, n - 1)

def smallest_multiple_helper(n: int, m: int) -> int:
    """ Helper function for smallest_multiple
    """
    if m == 0:
        return n
    if n % m == 0:
        return n
    else:
        return smallest_multiple_helper(n * m, m - 1)

def prime_factors(n: int) -> list:
    """ For a given number n, find all prime factors of n
    >>> prime_factors(15)
    [3, 5]
    """
    factors = []
    for i in range(2, n + 1):
        while n % i == 0:
            factors.append(i)
            n //= i
    return factors

def prime_factors_helper(n: int, m: int) -> list:
    """ Helper function for prime_factors
    """
    factors = []
    for i in range(2, m + 1):
        while n % i == 0:
            factors.append(i)
            n //= i
    return factors

