def fibonacci(n: int) -> int:
    """ Find the nth fibonacci number
    >>> fibonacci(5)
    5
    """
    if n == 0:
        return 0
    elif n == 1:
        return 1
    else:
        return fibonacci(n - 1) + fibonacci(n - 2)

def fibonacci_helper(n: int, m: int) -> int:
    """ Helper function for fibonacci
    """
    if m == 0:
        return 0
    elif m == 1:
        return 1
    else:
        return fibonacci_helper(n - 1, m - 1) + fibonacci_helper(n - 2, m - 1)

