def solve_quadratic(a: float, b: float, c: float) -> list:
    """Solve quadratic equation ax^2 + bx + c = 0"""
    if a == 0:
        return [0]
    elif a == 1:
        return [-c / b]
    elif b == 0:
        return [-c / a]
    x1 = (-b + math.sqrt(b * b - 4 * a * c)) / (2 * a)
    x2 = (-b - math.sqrt(b * b - 4 * a * c)) / (2 * a)
    return [x1, x2]

