    def get_coeff(xs, i):
        return xs[i] if i % 2 == 0 else xs[i - 1]

    def get_pow(xs, i):
        return i // 2 if i % 2 == 0 else i // 2 + 1

    def get_zero(xs):
        return -get_coeff(xs, 0) / get_coeff(xs, 1)

    def get_root(xs):
        if len(xs) == 2:
            return get_zero(xs)
        else:
            return get_zero(xs[2:])

    return [get_root(xs[::2])] + find_roots(xs[1::2])


