def count_primes(n):
    """Given a positive integer n, return the number of prime numbers that are less than or equal to n.
    Example: count_primes(10) ==> 4
    """
    if n < 2:
        return 0
    primes = [True for _ in range(n + 1)]
    primes[0] = primes[1] = False
    for i in range(2, int(math.sqrt(n)) + 1):
        if primes[i]:
            for j in range(i * i, n + 1, i):
                primes[j] = False
    return sum(primes)


