def is_palindrome(s):
    """Given a string s, return True if it is a palindrome, or False otherwise.
    Example: is_palindrome("aba") ==> True
    """
    i, j = 0, len(s) - 1
    while i < j:
        if s[i] != s[j]:
            return False
        i += 1
        j -= 1
    return True

