def dijkstra(graph, starting_point, ending_point):
    """
    Find the shortest path from the starting point to the ending point in a graph
    using Dijkstra's algorithm.
    """
    # keep track of the shortest path from the starting point to each node
    shortest_path = {starting_point: 0}
    # keep track of the nodes that have been visited
    visited = set()
    # keep track of the nodes that are in the queue
    queue = [(starting_point, 0)]
    while queue:
        # get the node with the shortest distance from the starting point
        node, distance = heappop(queue)
        # if the node has been visited, skip it
        if node in visited:
            continue
        # if the node is the ending point, return the shortest path
        if node == ending_point:
            return shortest_path[ending_point]
        # add the node to the visited set
        visited.add(node)
        # add the neighbors of the node to the queue
        for neighbor in graph[node]:
            if neighbor not in visited:
                # if the neighbor has not been visited, add it to the queue
                # with the distance from the starting point
                heappush(queue, (neighbor, distance + 1))
                # if the neighbor is not in the shortest path, add it to the shortest path
                if neighbor not in shortest_path:
                    shortest_path[neighbor] = distance + 1
    # if the ending point is not in the shortest path, return None
    if ending_point not in shortest_path:
        return None
    return shortest_path[ending_point]

