    neighbors = []
    if row > 0:
        neighbors.append((row-1, col))
    if row < len(grid)-1:
        neighbors.append((row+1, col))
    if col > 0:
        neighbors.append((row, col-1))
    if col < len(grid[0])-1:
        neighbors.append((row, col+1))
    return neighbors

