def is_prime(n):
    '''
    Create a function that takes an integer and returns True if it is a prime number, or False otherwise.
    Note: 0 and 1 are not prime.

    is_prime(0) ➞ False
    is_prime(1) ➞ False
    is_prime(2) ➞ True
    is_prime(3) ➞ True
    is_prime(4) ➞ False
    is_prime(5) ➞ True
    is_prime(6) ➞ False
    is_prime(7) ➞ True
    is_prime(8) ➞ False
    is_prime(9) ➞ False
    is_prime(10) ➞ False
    '''
    if n <= 1:
        return False
    else:
        for i in range(2, n):
            if n % i == 0:
                return False
        return True


