def has_prime(n):
    '''
    Create a function that takes a positive integer n and returns True if n has an odd number of prime factors, 
    or False if n has an even number of prime factors.

    has_prime(0) ➞ False
    has_prime(1) ➞ False
    has_prime(2) ➞ True
    has_prime(3) ➞ True
    has_prime(4) ➞ False
    has_prime(5) ➞ True
    has_prime(6) ➞ False
    has_prime(7) ➞ True
    has_prime(8) ➞ False
    has_prime(9) ➞ False
    has_prime(10) ➞ False
    '''
    if n == 0 or n == 1:
        return False
    else:
        if is_prime(n):
            return True
        else:
            n_factors = 0
            for i in range(2, n):
                if n % i == 0:
                    n_factors += 1
                    if is_prime(i):
                        return True
            if n_factors % 2 == 1:
                return True
            else:
                return False


