def sum_primes(n):
    '''
    Create a function that takes a positive integer n and returns the sum of all prime numbers up to n.
    Note: 0 and 1 are not prime.

    sum_primes(0) ➞ 0
    sum_primes(1) ➞ 0
    sum_primes(2) ➞ 2
    sum_primes(3) ➞ 2
    sum_primes(4) ➞ 2
    sum_primes(5) ➞ 5
    sum_primes(6) ➞ 5
    sum_primes(7) ➞ 10
    sum_primes(8) ➞ 10
    sum_primes(9) ➞ 10
    sum_primes(10) ➞ 17
    '''
    if n == 0 or n == 1:
        return 0
    else:
        sum = 0
        for i in range(2, n):
            if is_prime(i):
                sum += i
        return sum


