def is_rotation(s1, s2):
    '''
    Create a function that takes two strings as input and returns True if one string is a rotation of the other, or False otherwise.

    is_rotation('carrace', 'racecar') ➞ True
    is_rotation('hello', 'llohe') ➞ True
    is_rotation('world', 'dlrow') ➞ False
    is_rotation('world', 'dlrowa') ➞ False
    '''
    if len(s1) != len(s2):
        return False
    else:
        if s1 == s2:
            return True
        else:
            return is_palindrome(s1 + s2)


