    For s1 = "abcdef" and s2 = "cdef" the output should be "cdef"
    For s1 = "abcdef" and s2 = "fg" the output should be ""
    """
    s1 = s1.lower()
    s2 = s2.lower()
    if s1 == s2:
        return s1
    else:
        if len(s1) < len(s2):
            short = s1
            long = s2
        else:
            short = s2
            long = s1
        for i in range(len(short)):
            for j in range(len(long)):
                if short[i] == long[j]:
                    sub = short[i]
                    for k in range(i + 1, len(short)):
                        if short[k] == long[j + k - i]:
                            sub += short[k]
                        else:
                            break
                    if len(sub) > len(longest_common_substring(short[:i], long[:j])):
                        longest_common_substring(short[:i], long[:j])
                    return sub
                else:
                    continue
        return ""


