# 6. Write a function that returns the md5 hash of a file.
def file_to_md5(filename):
    """
    Given a filename 'filename', return its md5 hash equivalent string.
    If 'filename' does not exist, return None.

    >>> file_to_md5('test.txt') == '3e25960a79dbc69b674cd4ec67a72c62'
    """
    if not os.path.exists(filename):
        return None
    with open(filename, 'rb') as f:
        return hashlib.md5(f.read()).hexdigest()


# 7. Write a function that returns the md5 hash of a directory.
def directory_to_md5(directory):
    """
    Given a directory 'directory', return its md5 hash equivalent string.
    If 'directory' does not exist, return None.

    >>> directory_to_md5('test') == '3e25960a79dbc69b674cd4ec67a72c62'
    """
    if not os.path.exists(directory):
        return None
    return hashlib.md5(os.path.abspath(directory)).hexdigest()


# 8. Write a function that returns the md5 hash of a file or directory.
def file_or_directory_to_md5(filename):
    """
    Given a filename or directory 'filename', return its md5 hash equivalent string.
    If 'filename' does not exist, return None.

    >>> file_or_directory_to_md5('test.txt') == '3e25960a79dbc69b674cd4ec67a72c62'
    >>> file_or_directory_to_md5('test') == '3e25960a79dbc69b674cd4ec67a72c62'
    """
    if not os.path.exists(filename):
        return None
    if os.path.isfile(filename):
        with open(filename, 'rb') as f:
            return hashlib.md5(f.read()).hexdigest()
    return hashlib.md5(os.path.abspath(filename)).hexdigest()


